import React from 'react';
import '../../App.css';
import NavBar from '../Navbar'
import Artists from '../Artists';
import './Playlistpopup';

  const Popup = props => {
  return (
    <>
      <NavBar />
      <Artists />
    <div className="popup-box">
      <div className="box">
        <span className="close-icon" onClick={props.handleClose}>x</span>
        {props.content}
      </div>
    </div>
    </>
  );
};

export default Popup;
